import React from "react";
import { formatPrice } from "../helpers";

class Order extends React.Component {

  render() {
    return (
      <div className="order-wrap">
        <h2>Order</h2>
        <ul className="order"><li>
        <span>
          <span className="count">1</span> lbs fish name
        </span>
        <span className="price">$123.123</span>
      </li></ul>
        <div className="total">
          <strong>Total: $1231.3123</strong>
        </div>
      </div>
    );
  }
}

export default Order;
